import React from 'react';
import GetStudentGradeForm from './GetStudentGradeForm';
import GetStudentMarksForm from './GetStudentMarksForm';
import AddMarksForm from './AddMarksForm';
import StudentForm from './StudentForm';
import UpdateMarksForm from './UpdateMarksForm';

const CombinedForms = () => {
  const containerStyle = {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  };

  const formTitleStyle = {
    fontSize: '24px',
    fontWeight: 'bold',
    marginBottom: '16px',
  };

  return (
    <div style={containerStyle}>
      <h2 style={formTitleStyle}>Student Form</h2>
      <StudentForm />

      <h2 style={formTitleStyle}>Add Student Marks</h2>
      <AddMarksForm />

      <h2 style={formTitleStyle}>Get Student Marks</h2>
      <GetStudentMarksForm />

      <h2 style={formTitleStyle}>Get Student Grade</h2>
      <GetStudentGradeForm />

      <h2 style={formTitleStyle}>Update Student Marks</h2>
      <UpdateMarksForm />









    </div>
  );
};

export default CombinedForms;
